// Even though these hash traits are not affected by code generation,
// it's important to define them in the same file as CSSPropertyID to avoid
// hard-to-diagnose problems from neglecting to include said traits.
// See https://crbug.com/1246970.
namespace WTF {
template <>
struct HashTraits<blink::CSSPropertyID>
    : GenericHashTraits<blink::CSSPropertyID> {
  static const bool kEmptyValueIsZero = true;
  static void ConstructDeletedValue(blink::CSSPropertyID& slot, bool) {
    slot = static_cast<blink::CSSPropertyID>(blink::kNumCSSPropertyIDs);
  }
  static bool IsDeletedValue(blink::CSSPropertyID value) {
    return static_cast<int>(value) == blink::kNumCSSPropertyIDs;
  }
};
}  // namespace WTF

